import React from "react";
import Footer from "./Footer";
import Header from "./Header";
import Note from "./Note";
import noteData from "../noteDeta";

function newNote(data) {
  return (
    <Note
      id={data.id}
      Key={data.id}
      title={data.title}
      content={data.content}
    />
  );
}
function App() {
  return (
    <div>
      <Header />
      {noteData.map(newNote)}
      <Footer />
    </div>
  );
}

export default App;
